import React from "react";
import { Link } from "react-router-dom";

function MainHome() {
  return (
    <div>
      <h1>Main Home</h1>
      <Link to="/instructor">Instructor</Link>
      <br />
      <Link to="/student">Student</Link>
    </div>
  );
}

export default MainHome;
